import { Form, Input, Checkbox, Button } from "antd"
import { LockOutlined, UserOutlined } from '@ant-design/icons';
import Footer from "../components/component-recycle/Footer";
import Header from "../components/component-recycle/Header";


function LoginRegister() {
    const onFinish = (values) => {
        console.log('Received values of form: ', values);
    };
    return (
        <>
            <Header />

            <div className="centerLogin">
                <div className="login box">
                    <h1>Login</h1>
                    <p>Already have an account? Please, login!</p>
                    <Form
                        name="normal_login"
                        className="login-form"
                        initialValues={{
                            remember: true,
                        }}
                        onFinish={onFinish}>
                        <Form.Item
                            name="email"
                            rules={[
                                {
                                    required: true,
                                    message: 'Please input your Email!',
                                },
                            ]}
                        >
                            <Input prefix={<UserOutlined className="site-form-item-icon" danger/>} placeholder="Username" />
                        </Form.Item>
                        <Form.Item
                            name="password"
                            rules={[
                                {
                                    required: true,
                                    message: 'Please input your Password!',
                                },
                            ]}
                        >
                            <Input
                                prefix={<LockOutlined className="site-form-item-icon" />}
                                type="password"
                                placeholder="Password"
                            />
                        </Form.Item>
                        <Form.Item>
                            <Form.Item name="remember" valuePropName="checked" noStyle>
                                <Checkbox>Remember me</Checkbox>
                            </Form.Item>
                            <Form.Item>
                            <Button type="primary" htmlType="submit" className="login-form-button">
                                Log in
                            </Button>

                        </Form.Item>
                            <Lin className="login-form-forgot" href="">
                                Forgot password
                            </Lin>
                        </Form.Item>


                    </Form>
                </div>
                <div className="register box">

                </div>
            </div>

            <Footer />
        </>);
}

export default LoginRegister;
